import { Button, Container, Stack } from "react-bootstrap";
import Col from "react-bootstrap/Col";
import Row from "react-bootstrap/Row";
import { Link } from "react-router-dom";
import IconCleaner from "../../../images/icon_cleaner.png";
import IconWaiter from "../../../images/icon_waiter.png";
import IconChef from "../../../images/icon_chef.png";
import IconStar from "../../../images/other_stars.png";
import homepageIcon from "../../../images/homepage_icon.png";
import logo from "../../../images/logo.PNG";
import "../../../style.css";
import QRCode from "react-qr-code";

function PrivateHomeClient() {
  return (
    <Container className="gx-0 fluid ">
      <Stack>
        <div className=" mx-auto">
          <img className="logo" src={logo} alt="logo" />
        </div>
        <div className="mx-auto mb-4">
          <img
            style={{ width: "128px", height: "96px" }}
            src={IconChef}
            className="image_selectRole"
            alt="icon"
          />
          <img
            style={{ width: "128px", height: "96px" }}
            src={IconCleaner}
            className="image_selectRole"
            alt="icon"
          />
          <img
            style={{ width: "128px", height: "96px" }}
            src={IconWaiter}
            className="image_selectRole"
            alt="icon"
          />
        </div>
        <div className="mx-auto mb-4">
          <img
            style={{ width: "40px", height: "40px", marginRight: "7px" }}
            src={IconStar}
            className="image_selectRole"
            alt="icon"
          />
          <img
            style={{ width: "40px", height: "40px" }}
            src={IconStar}
            className="image_selectRole"
            alt="icon"
          />
          <img
            style={{ width: "40px", height: "40px" }}
            src={IconStar}
            className="image_selectRole"
            alt="icon"
          />
        </div>
        <div
          className="text-center"
          style={{ marginRight: "65px", marginLeft: "65px" }}
        >
          <h1 className="h1-mt-15">How would you like to register? </h1>
        </div>
        <div className="" style={{ marginRight: "33px", marginLeft: "33px" }}>
          <p className="p-mt-28">
            Jorem ipsum dolor sit amet, consectetur adipiscing elit. Nconubia
            nostra, per inceptos himenaeos. Nconubia nostra, per{" "}
          </p>
        </div>
        <Link to="/signIn" style={{ textDecoration: "none", color: "inherit" }}>
          <div className="d-flex justify-content-center col-button button-mt-40">
            <Button
              style={{ marginLeft: "35px", marginRight: "35px" }}
              className="customButton1"
            >
              Log In
            </Button>
          </div>
        </Link>
        <Link
          to="/selectRole"
          style={{ textDecoration: "none", color: "inherit" }}
        >
          <div className="d-flex justify-content-center col-m-25 col-button ">
            <Button
              style={{ marginLeft: "35px", marginRight: "35px" }}
              className="customButton2"
            >
              Sign Up
            </Button>
          </div>
        </Link>
      </Stack>
    </Container>
  );
}

export default PrivateHomeClient;
